('287e232f-e884-42d7-9049-4909e6aa6be5', 'c9c7ae23-d3cb-48f7-be6b-aa2b2d0bb338', 'fe397f8c-f1e8-4a3c-bbfc-102482396aea', 0, 'KORNET AYAM 450GRAM', 'Umiami kornet  daging ayam diproduksi oleh PT. Elson Bernardi, sangat lezat digunakan sebagai lauk dengan nasi, atau sebagai campuran aneka makanan yang lain.\n\nKornet Umiami sudah mempunyai:\n• Izin Depkes dari BPOM.\n• Sertifikasi Halal dari MUI.\n• Sertifikasi Nomor Kontrol Veteriner (NKV).\n\nVarian:\n• Umiami kornet ayam.\n\nBerat: \n• 450 gr.\n\nKomposisi:\n• Daging ayam, air, penstabil nabati dan fosfat, gula, garam, penguat rasa, pewarna ponceau 4r, pengawet natrium nitrit dan sulfit.\n\nPetunjuk penyimpanan:\n• Lemari pendingin dengan suhu +5°C: 45 hari.\n• Lemari pembeku dengan suhu -18°C: 1 tahun.\n\nPetunjuk Penyajian:\n• Lelehkan kornet sapi atau ayam\n• Goreng dengan minyak panas dengan menggunakan api sedang, sampai berubah warna menjadi kecoklatan.\n• Angkat dan tiriskan.\n• Apabila masih ada sisa kornet, simpan dalam kemasan tertutup kedalam freezer dan sebaiknya digunakan lagi dalam jangka waktu maksimal 1 bulan setelah kemasan dibuka.', 'https://res.cloudinary.com/dnyzkgi84/image/upload/v1710225372/IMG_0280_efdf7o.jpg', 21500.0000, 0, 10, 0, 1, '2024-03-12 06:36:18.392', '2024-03-12 06:36:18.392', NULL),
