('d45276d9-96e3-4e04-b6f1-d4a16e8adc7b', 'c9c7ae23-d3cb-48f7-be6b-aa2b2d0bb338', 'ea9259e0-91f6-4b1a-9d63-35e77ba90b21', 0, 'DANCOW STRAWBERRY 36 x 110ML', 'Dancow Fortigro rasa Cokelat adalah\nadalah susu formula yang mendukung 10 Tanda Umum Anak Bergizi Baik karena mengandung nutrisi penting untuk pertumbuhan. Selain rasanya yang lezat dan disukai anak-anak, gulanya 25% lebih rendah.\nMengandung Protein, Zat Besi, Kalsium, Zink, Vit. C, Vit. A, Vit. B1, B2, B6 dan B9, Vit. D, Vit. E, Vit. K, serta Biotin untuk pertumbuhan anak yang optimal.\n\nManfaat :\n1. Memberikan nutrisi untuk anak pada usia diatas 1 tahun yang sedang mengalami pertumbuhan dan kegiatan fisik yang cukup beragam.\n2. Menunjang tumbuh kembang Si Buah Hati yang aktif.\n3. Kalsium yang berperan membantu pembentukan tulang dan mempertahankan kepadatan tulang dan gigi.\n4. Protein untuk membantu membangun dan memperbaiki jaringan tubuh.\n5. Zat besi yang membantu mencegah dan mengatasi anemia akibat defisiensi Zat Besi.\n6. Zinc untuk daya tahan tubuh Si Buah Hati yang aktif.\n\n*Perhatian: TIDAK COCOK UNTUK BAYI DI BAWAH 1 TAHUN. Nestle Dancow Frotigro bukan pengganti Air Susu Ibu (ASI) melainkan khusus untuk anak usia di atas 1 tahun.', 'https://res.cloudinary.com/dnyzkgi84/image/upload/v1709820324/PhotoRoom-20240208_191949_bh2l6o.png', 4000.0000, 0, 26, 0, 1, '2024-03-07 14:05:34.533', '2024-03-07 14:05:34.533', NULL),
