('d62cd5aa-3407-4911-b14b-f7a25cb2d34a', 'c9c7ae23-d3cb-48f7-be6b-aa2b2d0bb338', '4b404efd-f9ae-4077-a2c4-3e85eefc9038', 0, 'POP ICE PERMEN KARET 5X5X25G ', 'Selamat datang di produk Pop ice! Ini adalah produk yang cocok untuk Anda yang mencari camilan segar di hari-hari panas. Produk ini disebut juga dengan nama None, dan kami sangat senang bisa memperkenalkannya kepada Anda.\n\nPop ice adalah camilan es batu dengan rasa buah-buahan segar, yang bisa membuat harimu semakin menyenangkan. Produk ini terbuat dari bahan-bahan berkualitas tinggi dan dirancang khusus untuk memenuhi kebutuhanmu akan camilan sehat dan menyegarkan.\n\nDengan Pop ice, kamu tidak perlu khawatir mengonsumsi camilan berkalori tinggi karena produk kami tidak mengandung gula tambahan atau bahan pengawet berbahaya. Selain itu, kamu juga bisa menikmati rasa buah-buahannya tanpa perlu khawatir dengan kandungan pewarna atau pemanis buatan.\n\nCamilan Pop ice sangat cocok dinikmati di mana saja, baik saat sedang bersantai dirumah ataupun saat sedang dalam perjalanan. Dengan harganya yang terjangkau dan isi 10 pcs dalam satu paketnya membuatnya menjadi pilihan tepat sebagai pengganti cemilan lainnya.\n\nJadi tunggu apalagi? Dapatkan segera produk Pop Ice ini sebagai teman berkumpulmu bersama keluarga maupun teman-temanmu!', 'https://res.cloudinary.com/dnyzkgi84/image/upload/v1709897734/Photoroom-20240304_085746_1_tkg8mq.png', 11500.0000, 0, 1, 0, 1, '2024-03-08 11:35:37.546', '2024-03-08 11:35:37.546', NULL),
