('ddb56d33-0edf-48a0-9f5b-79def2880620', 'c9c7ae23-d3cb-48f7-be6b-aa2b2d0bb338', '716abf0f-fb04-4d91-8103-bfc94fe7aa61', 0, 'NABATI M1 CARAMEL', 'SELAMAT DATANG DI TOKO SNACK MAJUJAYA LOAKULU ', 'https://res.cloudinary.com/dnyzkgi84/image/upload/v1728290784/IMG-20241007-WA0021_p1gkbg.jpg', 2500.0000, 0, 1, 0, 1, '2024-10-07 08:46:30.231', '2024-10-07 08:46:30.231', NULL),
('ddd94ad4-a61a-4c65-82c5-e683a90d7574', 'c9c7ae23-d3cb-48f7-be6b-aa2b2d0bb338', 'fe397f8c-f1e8-4a3c-bbfc-102482396aea', 0, 'SHIFUDO CHICKEN DUMPLING 500GRAM', 'Terbuat dari bahan surimi terbaik dengan bumbu-bumbu yang khas. Dengan tekstur kenyal dan lembutnya, Chicken Dumpling ini semakin menggugah selera karena terdapat ayam juicy di dalamnya. Dapat dikonsumsi sebagai cemilan atau di kreasikan ke berbagai menu masakan favorit Anda.\n\nKomposisi:\nSurimi, Ayam, Air, Pati Jagung, Isolat Protein Kedelai, Tepung Terigu, Minyak Nabati, Garam, Gula, Bawang Putih, dan Lada.\n\nUkuran:\n500 g (isi 27-28)\n\nSaran penyajian: digoreng, direbus, dikukus, dan dibakar/dipanggang.\n\nKeunggulan :\nMengandung Omega 6 - Penting untuk pertumbuhan otak\nMengandung Omega 9 - Penting untuk mengurangi kadar lemak jahat dalam darah\nMengandung Asam Amino Essensial - Menjaga keseimbangan metabolisme tubuh & sebagai antioksidan', 'https://res.cloudinary.com/dnyzkgi84/image/upload/v1710316366/IMG_0352_wipdmk.jpg', 30000.0000, 0, 3, 0, 1, '2024-03-13 07:52:47.249', '2024-03-13 07:52:47.249', NULL),
('de309932-8032-4f9e-b6f2-407a04e54ea2', 'c9c7ae23-d3cb-48f7-be6b-aa2b2d0bb338', 'ea9259e0-91f6-4b1a-9d63-35e77ba90b21', 0, 'HEMAVITON ENERGY DRINK 5X10X150ML', 'Salam sehat selalu! Inilah HEMAVITON, minuman energy drink dalam botol 150ml yang siap memberikan energi ekstra bagi tubuhmu. \n\nHEMAVITON adalah minuman energi yang dapat membantu meningkatkan stamina dan mempercepat pemulihan setelah beraktivitas. Dengan kandungan gula dan kafein yang tepat, HEMAVITON mampu memberikan energy boost agar kamu bisa menjalani aktivitas dengan lebih produktif.\n\nDalam setiap botolnya, HEMAVITON mengandung bahan-bahan alami seperti ekstrak ginseng dan vitamin B complex. Kedua bahan ini dikenal untuk membantu meningkatkan metabolisme tubuh serta menjaga kestabilan kadar glukosa dalam darah.\n\nTidak hanya itu, rasa dari minuman ini sangat segar dengan gabungan buah-buahan tropis seperti jeruk nipis dan leci. Kamu dapat menikmati kesegaran dari rasa buah tropis tersebut sambil mendapatkan energi ekstra dari kafein di dalamnya.\n\nHEMAVITON merupakan pilihan tepat bagi kamu yang membutuhkan tambahan tenaga untuk beraktivitas sehari-hari atau menghadapi aktivitas fisik secara intensif. Berani mencoba? Ayo tambahkan HEMAVITON ke daftar belanjaanmu hari ini!', 'https://res.cloudinary.com/dnyzkgi84/image/upload/v1709887239/PhotoRoom-20240208_202733_dojoov.png', 6000.0000, 0, 1, 0, 1, '2024-03-08 08:40:41.772', '2024-03-08 08:40:41.772', NULL),
